import '../style/TodoListDate.css';

const TodoListDate = () => {

    // 자바스크립트 날짜 데이터 가져오기.
    // new 키워드를 사용하여 Date 객체 가져오기.
    const timeData = new Date();

    const timeString1 = timeData.toLocaleString();
    const timeString2 = timeData.toLocaleString('ko-kr');
    const timeString3 = timeData.toLocaleString('en-us');

    const timeString4 = timeData.toLocaleString('ko-kr');
    const timeString5 = timeData.toLocaleString();
    const timeString6 = timeData.toLocaleString('ko-kr');


	return (
        <div className='todolist-date'>
            <h4>{timeString1}</h4>
            <h4>{timeString2}</h4>
            <h4>{timeString3}</h4>
            <h4>{timeString4}</h4>
            <h4>{timeString5}</h4>
            <h4>{timeString6}</h4>
        </div>
    )
}

export default TodoListDate;
